import React, { Suspense } from "react";
import { NavLink, Route, Switch } from "react-router-dom";
import MainMainNavigation from "./Navigation/MainNavigation";
import MainNavigation from "./Navigation/Navigation";
const Items = React.lazy(() => import("src/views/Home/Product/Item"));
const Login = React.lazy(() => import("src/views/pages/login/Login"));
const Home = () => {
  return (
    <>
      {/* <MainNavigation />
      <MainMainNavigation />
      <Switch>
        <Route path="/home" component={Items} />
        <Route
          exact
          path="/home/login"
          name="Login"
          render={(props) => <Login {...props} />}
        />
      </Switch> */}
      <header>
        <NavLink></NavLink>
      </header>
    </>
  );
};
export default Home;
